prompt --application/pages/page_00001
begin
wwv_flow_imp_page.create_page(
 p_id=>1
,p_name=>'Home'
,p_alias=>'HOME'
,p_step_title=>'Agenzia Spaziale'
,p_autocomplete_on_off=>'OFF'
,p_javascript_code_onload=>wwv_flow_string.join(wwv_flow_t_varchar2(
'// Variabile per tenere traccia se il robottino si sta muovendo',
'let isMoving = false;',
'',
'// Funzione per far salutare il robottino',
'function robotWave() {',
'  const robot = document.getElementById(''robot'');',
'',
unistr('  // Esegui il saluto solo se il robottino non \00E8 in movimento'),
'  if (!isMoving) {',
'    // Aggiunge una classe per l''animazione del saluto',
'    robot.classList.add(''wave'');',
'',
'    // Rimuove la classe dopo 2 secondi',
'    setTimeout(() => {',
'      robot.classList.remove(''wave'');',
'    }, 2000);',
'  }',
'}',
'',
'// Funzione per muovere il robottino in modo casuale e lento',
'function moveRobotRandomly() {',
'  const robot = document.getElementById(''robot'');',
'',
'  // Ottieni la larghezza e altezza del contenitore per limitare il movimento',
'  const moonScene = document.getElementById(''moon-scene'');',
'  const moonSceneWidth = moonScene.offsetWidth;',
'  const moonSceneHeight = moonScene.offsetHeight;',
'',
'  // Ottieni posizioni casuali per X e Y senza uscire dai bordi',
'  const randomX = Math.random() * (moonSceneWidth - robot.offsetWidth);',
'  const randomY = Math.random() * (moonSceneHeight - robot.offsetHeight);',
'',
'  // Inizia il movimento',
'  isMoving = true;',
'  ',
'  // Applica le nuove posizioni al robottino con un ritardo per simulare il movimento',
'  setTimeout(() => {',
'    robot.style.left = `${randomX}px`;',
'    robot.style.bottom = `${randomY}px`;',
'  }, 100);  // Piccolo ritardo per evitare l''animazione immediata del movimento',
'',
unistr('  // Dopo che il movimento \00E8 completato, impostiamo il robottino come fermo'),
'  setTimeout(() => {',
'    isMoving = false;',
unistr('  }, 2000);  // Tempo di movimento, che \00E8 2s'),
'}',
'',
'// Muovi il robottino ogni 3-5 secondi in modo casuale',
'let moveInterval = setInterval(moveRobotRandomly, Math.random() * 2000 + 3000);',
'',
'// Funzione per fermare il movimento durante il saluto',
'function stopMovement() {',
'  clearInterval(moveInterval);',
'}',
'',
'// Funzione per riprendere il movimento dopo il saluto',
'function resumeMovement() {',
'  moveInterval = setInterval(moveRobotRandomly, Math.random() * 2000 + 3000);',
'}',
'',
'// Ogni 5-10 secondi, il robottino saluta, ma solo quando non si sta muovendo',
'setInterval(() => {',
'  robotWave();',
'  stopMovement();  // Ferma il movimento durante il saluto',
'  setTimeout(() => {',
'    resumeMovement();  // Riprende il movimento dopo 2 secondi',
'  }, 2000);',
'}, Math.random() * 5000 + 5000);',
''))
,p_inline_css=>wwv_flow_string.join(wwv_flow_t_varchar2(
'/* Sfondo della luna */',
