'            <h1>Partenopei Destiny Frontier</h1>',
'            <p>',
unistr('                Dove il cielo non \00E8 il limite, ma solo l''inizio.'),
'',
unistr('Nata dal desiderio di spingersi oltre i confini dell''ignoto, Partenopei Destiny Frontier \00E8 un\2019agenzia spaziale che combina l\2019orgoglio delle proprie radici partenopee con la passione per l\2019esplorazione del cosmo. La nostra missione \00E8 aprire nuove fron')
||unistr('tiere, portando l\2019ingegno e l\2019energia del nostro territorio verso le stelle.'),
'',
unistr('Proprio come il Vesuvio domina il Golfo di Napoli, noi vogliamo dominare il cielo, spingendoci verso nuovi orizzonti. Ogni lancio \00E8 un passo avanti verso un futuro in cui l\2019umanit\00E0 pu\00F2 esplorare, scoprire e prosperare su nuovi mondi.'),
'            </p>',
