'       COUNT(DISTINCT S.codice) AS "Numero di Sensori"',
'FROM ',
'    MISSIONI M',
'JOIN ',
'    PARTECIPAZIONI P ON P.missione = M.codice',
'JOIN ',
'    MEMBRI_EQUIPAGGIO MB ON MB.codice = P.membro',
'JOIN ',
'    IMPIEGO_SENSORI ISE ON M.codice = ISE.missione',
'JOIN ',
'    SENSORI S ON ISE.sensore = S.codice',
'WHERE (UPPER(MB.matricola) = UPPER(:APP_USER) AND M.stato=''INCORSO'') OR UPPER(:APP_USER) = ''SUPERVISOR''',
