,p_plug_new_grid_column=>false
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
unistr('    A.livello_priorita AS "Priorit\00E0",'),
'    COUNT(DISTINCT A.codice) AS "Numero di Anomalie",',
'    COUNT(DISTINCT R.codice) AS "Numero di Rilevazioni",',
'    ROUND(COUNT(DISTINCT R.codice) * 1.0 / COUNT(DISTINCT A.codice), 4) AS "Rapporto RILEVAZIONI_ANOMALIE"',
'FROM ',
'    MISSIONI M',
'JOIN ',
'    PARTECIPAZIONI P ON P.missione = M.codice',
'JOIN ',
'    MEMBRI_EQUIPAGGIO MB ON MB.codice = P.membro',
'JOIN ',
'    IMPIEGO_SENSORI ISE ON M.codice = ISE.missione',
'JOIN ',
'    SENSORI S ON ISE.sensore = S.codice',
'JOIN    ',
'    ANOMALIE A ON A.sensore = S.codice',
'LEFT JOIN',
'    RILEVAZIONI R ON R.sensore = S.codice',
'WHERE ',
'    (UPPER(MB.matricola) = UPPER(:APP_USER) AND M.stato = ''INCORSO'') ',
'    OR UPPER(:APP_USER) = ''SUPERVISOR''',
'GROUP BY ',
'    A.livello_priorita',
'HAVING ',
'    COUNT(DISTINCT A.codice) > 0',
'ORDER BY ',
'    A.livello_priorita ASC;',
''))
