begin
wwv_flow_imp_page.create_page(
 p_id=>3
,p_name=>'Modello3D'
,p_alias=>'MODELLO3D'
,p_step_title=>'Modello3D'
,p_autocomplete_on_off=>'OFF'
,p_javascript_file_urls=>wwv_flow_string.join(wwv_flow_t_varchar2(
'https://cdn.babylonjs.com/babylon.js',
'https://cdn.babylonjs.com/loaders/babylonjs.loaders.min.js'))
,p_javascript_code_onload=>wwv_flow_string.join(wwv_flow_t_varchar2(
'// CSS inline per il canvas',
'apex.jQuery("#renderCanvas").css({',
'    "width": "100%",',
'    "height": "600px",',
'    "touch-action": "none"',
'});',
'',
'// CSS per il testo di caricamento',
'apex.jQuery("#loadingText").css({',
'    "position": "absolute",',
'    "top": "50%",',
'    "left": "50%",',
'    "transform": "translate(-50%, -50%)",',
'    "color": "white",',
'    "font-family": "Arial, sans-serif"',
'});',
'',
'// Funzione per convertire coordinate geografiche in coordinate 3D',
'function geoTo3D(lat, lon, radius) {',
'    const phi = (90 - lat) * (Math.PI / 180);',
'    const theta = (lon + 180) * (Math.PI / 180);',
'    ',
'    return {',
'        x: -radius * Math.sin(phi) * Math.cos(theta),',
'        y: radius * Math.cos(phi),',
'        z: radius * Math.sin(phi) * Math.sin(theta)',
'    };',
'}',
'',
'const canvas = document.getElementById("renderCanvas");',
'const loadingText = document.getElementById("loadingText");',
'const engine = new BABYLON.Engine(canvas, true);',
'',
'const createScene = async function() {',
'    const scene = new BABYLON.Scene(engine);',
'    scene.clearColor = new BABYLON.Color3(0, 0, 0.1);',
'',
'    // Camera',
'    const camera = new BABYLON.ArcRotateCamera("camera", 0, Math.PI / 2, 15, ',
'        new BABYLON.Vector3(0, 0, 0), scene);',
'    camera.attachControl(canvas, true);',
'    camera.lowerRadiusLimit = 10;',
'    camera.upperRadiusLimit = 30;',
'',
'    // Luci',
'    const light = new BABYLON.HemisphericLight("light", ',
'        new BABYLON.Vector3(0, 1, 0), scene);',
'    light.intensity = 0.7;',
'',
'    const pointLight = new BABYLON.PointLight("pointLight", ',
'        new BABYLON.Vector3(0, 0, 0), scene);',
'    pointLight.intensity = 0.5;',
'',
'    // Creazione della sfera della Luna',
'    const moon = BABYLON.MeshBuilder.CreateSphere("moon", {',
'        diameter: 8,',
'        segments: 64',
'    }, scene);',
'',
'    // Material per la Luna con texture',
'    const moonMaterial = new BABYLON.StandardMaterial("moonMaterial", scene);',
'',
'    // Texture della Luna',
'    const moonTexture = new BABYLON.Texture(',
'        "#APP_FILES#Luna.jpg", ',
'        scene',
'    );',
'    moonMaterial.diffuseTexture = moonTexture;',
'    moon.material = moonMaterial;',
'',
'    // Carica i dati reali dei sensori da P1_SENSORI',
'    const rawSensorData = apex.item(''P1_SENSORI'').getValue();',
'    console.log("Dati grezzi P1_SENSORI:", rawSensorData);',
'    const sensorData = JSON.parse(rawSensorData || "[]");',
'    console.log("Dati sensori dopo il parsing:", sensorData);',
'',
'    // Creazione dei sensori',
'    sensorData.forEach(sensor => {',
'        const pos = geoTo3D(sensor.lat, sensor.lon, 4.1); // Usa latitudine, longitudine e raggio',
'        console.log(`Sensor ${sensor.id}: Posizione calcolata`, pos);',
'',
'        const sensorMesh = BABYLON.MeshBuilder.CreateSphere("sensor" + sensor.id, {',
'            diameter: 0.15',
'        }, scene);',
'    ',
'        console.log(`Mesh creata per sensore ${sensor.id}:`, sensorMesh);',
'',
'        sensorMesh.position = new BABYLON.Vector3(pos.x, pos.y, pos.z);',
'',
'        const sensorMaterial = new BABYLON.StandardMaterial("sensorMat" + sensor.id, scene);',
'        sensorMaterial.emissiveColor = new BABYLON.Color3(0, 1, 0);',
'        sensorMaterial.alpha = 0.8;',
'        sensorMesh.material = sensorMaterial;',
'',
'        // Click action per mostrare i dettagli del sensore',
'        sensorMesh.actionManager = new BABYLON.ActionManager(scene);',
'        sensorMesh.actionManager.registerAction(',
'            new BABYLON.ExecuteCodeAction(',
'                BABYLON.ActionManager.OnPickTrigger,',
'                function() {',
'                    apex.message.alert(',
'                        "Sensore ID: " + sensor.id + ',
'                        "\nLatitudine: " + sensor.lat + ',
'                        "\nLongitudine: " + sensor.lon + ',
'                        "\nAltitudine: " + sensor.alt + ',
'                        "\nData Installazione: " + sensor["D.I."] + ',
'                        "\nData Ultimo Controllo: " + sensor["D.U.C."] +',
'                        "\nTipo: " + sensor.type',
'                    );',
'                }',
'            )',
'        );',
'    });',
'    ',
'    console.log("Mesh totali nella scena:", scene.meshes.length);',
'',
'    loadingText.style.display = ''none'';',
'    return scene;',
'};',
'',
'createScene().then(scene => {',
'    engine.runRenderLoop(function() {',
'        scene.render();',
'    });',
'});',
'',
'// Gestione del ridimensionamento',
'apex.jQuery(window).resize(function() {',
'    engine.resize();',
'});'))
,p_page_template_options=>'#DEFAULT#'
,p_protection_level=>'C'
,p_page_component_map=>'17'
,p_last_updated_by=>'TEST1'
,p_last_upd_yyyymmddhh24miss=>'20250107225545'
);
