,p_attribute_01=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    l_json_data CLOB;  -- Variabile per contenere il risultato JSON',
'BEGIN',
'    -- Esegui la query per ottenere i dati JSON',
'    SELECT json_arrayagg(',
'               json_object(                  ',
'                   ''state'' VALUE S.stato,',
'                   ''id'' VALUE S.codice,',
'                   ''D.I.'' VALUE S.data_installazione,',
'                   ''D.U.C.'' VALUE  S.data_ultimo_controllo,',
'                   ''type'' VALUE S.tipologia,',
'                   ''lat'' VALUE S.latitudine,',
'                   ''lon'' VALUE S.longitudine,',
'                   ''alt'' VALUE S.altitudine',
'               )',
'           )',
'    INTO l_json_data  -- Memorizza il risultato nella variabile l_json_data',
'    FROM SENSORI S',
'    JOIN IMPIEGO_SENSORI I ON S.codice = I.sensore',
'    JOIN MISSIONI M ON I.missione = M.codice',
'    JOIN PARTECIPAZIONI P ON M.codice = P.missione',
'    JOIN MEMBRI_EQUIPAGGIO ME ON P.membro = ME.codice',
'    WHERE (UPPER(ME.matricola) = UPPER(:APP_USER));    ',
'',
'    -- Puoi usare la variabile l_json_data come desiderato',
'    :P1_SENSORI := l_json_data;',
'END;'))
,p_attribute_05=>'PLSQL'
,p_wait_for_result=>'Y'
);
