,p_plug_display_sequence=>10
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT M.obiettivo,TO_CHAR(data_inizio, ''DD/MM/YYYY'') AS DATA_INIZIO,',
'    CASE ',
'        WHEN data_fine IS NULL OR data_fine > SYSDATE THEN ''IN CORSO''',
'        ELSE TO_CHAR(data_fine, ''DD/MM/YYYY'')',
'    END AS data_fine,',
'    M.stato',
'FROM MISSIONI M',
'JOIN PARTECIPAZIONI P ON P.missione=M.codice',
'JOIN MEMBRI_EQUIPAGGIO MB ON MB.codice=P.membro',
'WHERE UPPER(MB.matricola) = UPPER(:APP_USER) OR UPPER(:APP_USER)=''SUPERVISOR''',
